import React, { Component } from 'react';
import search from '../../assets/icons/search-solid.svg';

class Footer extends Component {
    render() {
        return (
            <div className='footer'>
                <h1 className='footer__text'>FAQ - PERGUNTAS FREQUENTES</h1>
                <div className='footer__div2'>
                    <input type='text' placeholder='Busque por termo...' className='footer__busca'></input>
                    <div className='footer__div3'>
                        <img src={search} alt='src' className='footer__icon'></img>
                        <button className='footer__button'>buscar</button>
                    </div>
                </div>
            </div>
        );
    }
}
export default Footer;
